import React from 'react';
const Consumi = () =>{
    let listaConsumi = [
        {
            km : 400,
            litri : 32.7,
            commento : "fuzinona"
        },
        {
            km : 500,
            litri : 33.7,
            commento : "fuzinona"
        },
        {
            km : 560,
            litri : 2345.7,
            commento : "funziona"
        },
    ];


    return(
        listaConsumi.map((value)=> {
            return( divConsumo(value.km, value.litri, value.commento))})
    );
}

const divConsumo = (props) =>{
    const {km, litri, commento} = props;

    return(
        <>
            <div className={"col-md-12"}>
                <div className={"col"}>
                    {km}
                </div>
                <div className={"col"}>
                    {litri}
                </div>
                <div className={"col"}>
                    {commento}
                </div>
            </div>
        </>
    );
}
export default Consumi;
